import React, { useEffect, useState } from 'react';
import { useAuth } from '../../contexts/AuthContext';
import api from '../../services/api';

interface DashboardData {
  user: any;
  property: any;
  cottages: any[];
  available_weekday: number;
  available_weekend: number;
  pending_weekday: number;
  pending_weekend: number;
}

const Dashboard: React.FC = () => {
  const { user } = useAuth();
  const [dashboardData, setDashboardData] = useState<DashboardData | null>(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboard();
  }, []);

  const fetchDashboard = async () => {
    try {
      const response = await api.get('/api/owner/dashboard');
      setDashboardData(response.data);
    } catch (error) {
      console.error('Error fetching dashboard:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) return <div>Loading...</div>;
  if (!dashboardData) return <div>Error loading dashboard</div>;

  return (
    <div>
      <div className="card">
        <h2>Welcome, {dashboardData.user.name}!</h2>
        <p><strong>Property:</strong> {dashboardData.property?.name}</p>
      </div>

      <div className="card">
        <h3>Quota Status (OWN-08, OWN-09)</h3>
        <div style={{ display: 'flex', gap: '20px', marginTop: '20px' }}>
          <div>
            <h4>Weekday Credits</h4>
            <p><strong>Available:</strong> {dashboardData.available_weekday}</p>
            <p><strong>Pending (Escrow):</strong> {dashboardData.pending_weekday}</p>
            <p><strong>Total Balance:</strong> {dashboardData.user.weekday_balance}</p>
          </div>
          <div>
            <h4>Weekend Credits</h4>
            <p><strong>Available:</strong> {dashboardData.available_weekend}</p>
            <p><strong>Pending (Escrow):</strong> {dashboardData.pending_weekend}</p>
            <p><strong>Total Balance:</strong> {dashboardData.user.weekend_balance}</p>
          </div>
        </div>
      </div>

      <div className="card">
        <h3>Available Cottages</h3>
        <table className="table">
          <thead>
            <tr>
              <th>Cottage ID</th>
              <th>Capacity</th>
              <th>Amenities</th>
            </tr>
          </thead>
          <tbody>
            {dashboardData.cottages.map((cottage) => (
              <tr key={cottage.id}>
                <td>{cottage.cottage_id}</td>
                <td>{cottage.capacity}</td>
                <td>{cottage.amenities || 'N/A'}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Dashboard;
